import styled from 'styled-components';

export const StyledHeaderWrapper = styled.div`
    width: 100vw;
    height: 7vh;
    background-color: #000000;
    display: flex;
    flex-direction: row;
    justify-content : space-between;
    position: sticky;
    top : 0px;
    z-index:1;
`
